import { StyleSheet } from "react-native";


const someStyles = StyleSheet.create({
    container: {
      flex: 1,
      padding: 24,
      backgroundColor: 'grey',
    },

    image: {
        width: 200,
        height: 200,
        marginBottom: 60,
        borderRadius:20,
        //tintColor: 'white',

      },

});


export default someStyles;
